import styled from "styled-components";

export const StyledLogin = styled.div`
  display: flex;
  width: 100vw;

  .svgContainer {
    flex: 1;
    display: flex;
    align-items: c;
  }

  .svgContainer img {
    width: 80%;
    height: 500px;
  }

  .loginContainer {
    flex: 1;
  }
`;
